import "./home.css"
import blogs from "./../../data"
import BlogCard from "../../components/blog card/BlogCard"

function Home() {

  console.log(blogs)
  return (
    <>
    {
      blogs.map((blogObject, i)=>{
      const {
        title,
        content,
        author,
        date,
        categories
      } = blogObject

      return (
        <BlogCard
        key={i}
        title={title}
        content={content}
        author={author}
        date={date}
        categories={categories}
        />)

    
      
    })
  }
    </>
 
  )
}

export default Home
